import React from 'react';
import LOGO from "../images/Ferrari-Scuderia-Symbol.png"


const Header = () => {
  return (
    <div className='header'>
      <div className='logo'>
        <img src={LOGO} alt="logo"/>
      </div>

    </div>
  );
}

export default Header;
